  useEffect(async () => {
    let str = window.location.search.slice(1)

    console.log(str)
    if (str.length) {
      await API.зщые('/prilipals/video', { params: { str } })
        .then(
          res => console.log(res.data)
        )
    }

    // GET prilipals/video

  }, [])
  return (
    <Router>
      <div className="app w-full ubuntu">
        <Switch>
          <Route path='/tresnutye' exact><IndexPage page='main' /></Route>
